pragma solidity 0.8.10;

contract Auction {

  struct Water {
    uint id;
    address owner;
    bool active;
    string waterSource;
    string waterLocation;
    uint amount;
    uint price;
    bool forSale;
    bool rightType;
    uint leaseLength;
  }

