  address oldOwner = water[id].owner;

  uint oldOwnerLength = owners[oldOwner];

  for (uint i=0; i<oldOwnerLength; i++) {
     if (ownership[oldOwner][i].id == id) {
       ownership[oldOwner][i].forSale=true;
       break;
     }
   }
}



